INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "青空の下で謁見", "フリーマーケット会場", 8, 2834, 0, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 10118, 0, 1, 91002, 5118061, 2, "ペコリーヌとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "未来の騎空団\nマスコット？", "フリーマーケット会場", 8, 2835, 0, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 10118, 0, 1, 91002, 5118062, 2, "マホとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "お嬢さまからの\n緊急依頼", "ランドソル市街地", 8, 2837, 0, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 10118, 0, 1, 91002, 5118063, 2, "アキノとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "黄金色の悩みごと", "フリーマーケット会場", 8, 4108402, 0, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 10118, 0, 1, 91002, 5118064, 2, "ジュンとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "白熱！　格闘大会！", "フリーマーケット会場", 8, 4107402, 0, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 10118, 0, 1, 91002, 5118065, 2, "カオリとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "祭り太鼓はオーエドの華", "オーエド町", 8, 9000227, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 10118, 0, 1, 91002, 5118066, 2, "ニノンとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "人気者は遅れて\nやってくる", "フリーマーケット会場", 8, 2101181, 0, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 10118, 0, 1, 91002, 5118067, 3, "スズナとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "巫女・ミーツ・魔法少女", "ランドソル市街地", 8, 4109402, 0, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 10118, 0, 1, 91002, 5118068, 3, "ナナカとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "ネズ耳は二度なくなる", "フリーマーケット会場", 8, 4305402, 0, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 10118, 0, 1, 91002, 5118069, 3, "キャル＆コッコロとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "この出会いにカンパイ！", "ランドソル市街地", 8, 4101402, 0, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 10118, 0, 1, 91002, 5118070, 3, "ユカリとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "陰陽アンサンブル", "ランドソル市街地", 8, 4106402, 0, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 10118, 0, 1, 91002, 5118071, 3, "アオイとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (40, "運試し十番勝負！", "フリーマーケット会場", 8, 2836, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 10118, 0, 1, 91002, 5118072, 3, "シノブとの出会い");
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, "彼女たちの新たな日常", 0, 0, 0, 0, 0, 0, 10118, 10145115, 0, 0, 5118600, 1, "オープニング");
